import './App.css'
import MainDash from './components/MainDash/MainDash';
import Sidebar from './components/Sidebar';

function App() {
  return (
    <div className="App">
      <div className="AppAfter">
        <div className='Amazon'>
          <Sidebar />
          <MainDash />
        </div>
      </div>
    </div>
  );
}

export default App;
